// SignOut.js


import React from 'react';

const LogIn = () => {
  return (
    <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '20px' }}>
      {/* Left side div with lorem ipsum */}
      <div style={{ flex: '1', paddingRight: '20px', fontSize: '18px' }}> {/* Adjust font size */}
        <h2 style={{ fontSize: '24px' }}>Budget Brain Ti</h2> {/* Adjust font size */}
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore
          magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo
          consequat.
        </p>
      </div>

      {/* Right side login screen */}
      <div style={{ flex: '1', paddingLeft: '20px' }}>
        <center>
          <div style={{ fontSize: '16px' }}> {/* Adjust font size */}
            <h2 style={{ fontSize: '20px' }}>Log In Page</h2> {/* Adjust font size */}
            <p style={{ fontSize: '14px' }}>Log in to access your account.</p> {/* Adjust font size */}

            <input type="text" id="username" name="uname" placeholder='Enter your Username'></input><br></br>
            <input type="text" id="password" name="pswd" placeholder='Enter your Password'></input><br></br>

            <a href="/about"><button type="submit">Login</button></a>
            <a href="/signin"><button type="submit">Don't have an account? Signup!</button></a>
          </div>
        </center>
      </div>
    </div>
  );
};

export default LogIn;
